Kathryn Perez &quot;SEX Unlimited: The Complete Volumes&quot;
Amazon Digital Services, Inc. | English | September 21, 2014 | ASIN: B00NTBDQY4 | 188 pages | azw, epub, lrf, mobi | 3,08 mb

Who? Kathryn. She's one author who can take this amazing, steamy, and hot book and make it into so much more. There's a whole beautiful, amazing story wrapped up in this series, so it's not just about the act itself. When Candace decides to venture into this little no strings attached world, she gets a whole lot more than what she bargains for with the delicious Brisban. Don't miss this chance to get all three books in one purchase because you will not be disappointed! A hot read that's guaranteed to make you laugh and cry! Katy never lets me down and this is just one more to add to her list of books that have nailed me!
